import React, { Component } from "react";
import "./style.css";
import {Col} from "../Grid";

class BlockPreview extends Component {
  render() {
      return (
        <Col size="md-4">
          <div className="card">
            <div className="card-title"><h2>For Whatever Reason</h2></div>
            <div className="preview-text"><i>It never occured to Ethan that staying up all night would lead to his demise. He was so sick to his stomach the next day.</i></div>
            <div className="container">
            <h6 className="word-count">Word Count</h6>
            <h6 className="contributor-count">No. of Contributors</h6>
            </div>
          </div>
          </Col>
      )
  }
}

export default BlockPreview;
